import axios from 'axios'
axios.defaults.baseURL='https://mock.apifox.cn/m1/2355324-0-default'
// axios.defaults.baseURL='/m1/2355324-0-default'
export function getCityInformation() {
  return axios.get('/api/smartcity/info')
}

export function getCityList() {
  return axios.get('/api/smartcity/list')
}
